import React from "react";
import "./MidSection.css";

export default function MIdSection() {
  return (
    <div className="wrapper">
      <div className="section">
        <div className="text">
          <div className="head"></div>
        </div>
        <div className="image">
          <img src="Assets/rrrrr.png" />
        </div>
      </div>
    </div>
  );
}
